insert  into `comments`(`CommentId`,`PostId`,`PostTitle`,`Comment_data`,`user_id`,`CommentDate`) values (5,1,'Game Of Thrones','Got is back hurray !!','user_id','2016-04-13'),(9,3,'Prince William and Kate Middleton in India','yahoooo','user_id','2016-04-13'),(13,1,'Game Of Thrones','A Lannister always pays his debt !','suyashsoni71','2016-04-19'),(15,1,'Game Of Thrones','<em>To hell with him , you owe me 2000 <b>@suyashsoni71</b></em>','ysoni01','2016-04-20'),(39,1,'Game Of Thrones','Hurray !! ','ysoni01@yahoo.com','2016-05-11'),(40,7,'yahoo','commented through fb','ysoni01@yahoo.com','2016-05-11'),(48,4,'5 Reasons Why Its Awesome To Work In A Start-Up','<p style=\"color:red\">The environment and interaction is <em>amazing</em> in such organisations..</p>','ysoni01','2016-05-28'),(50,4,'5 Reasons Why Its Awesome To Work In A Start-Up','<p style=\"color:blue\"><em>Yes It is...</em></p>','jain.prachi94','2016-05-28');

